import React from 'react';
import classes from"./HeaderMusic.module.css";

const HeaderMusic = () => {
    return (
    <div className={classes.headerMusic}>
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRYkkqwJZSG6lUDXS1DRXpD5Zy_BRzLCO7Xp-hU2yJgX5D6ppEq" alt="music"></img>
    </div>
    );
}

export default HeaderMusic;
